window.new_stim = [window.img_root + this.parameters.img_left, window.img_root + this.parameters.img_right];

function changeImage(element, path) {
  element.src = path;
}

// For image selection feedback
let display_left = document.getElementById('display_left');
let display_right= document.getElementById('display_right');


let selections = {
  '0': display_left,
  '1': display_right,
}

let trial_stimuli = [this.parameters.img_left, this.parameters.img_right];

// allow a moment for image load time, thus 'ensuring' perception of equal presentation times
let onset_stimulus = 1500; //ms -- ISI =  onset_stimulus - onset_cue
let onset_cue = 500;
let fps = 60;
let load_once = true;
let only_once_stim = true;
let only_once_cue = true;
let one_response = true;

let start_time = new Date();

run_trial = () => {
  let current_time = new Date();
  trial_timer = current_time - start_time - onset_stimulus;

  // load the images within the 1000ms ISI
  if (trial_timer != onset_stimulus && load_once){
    changeImage(display_left, window.new_stim[0]);
    changeImage(display_right, window.new_stim[1]);
    if (window.feedback){
      
      if (window.response_time < window.fast_response){
        document.getElementById('cue_display').innerHTML = 'Too Fast!';
      } 
      if (window.timed_out) {
        document.getElementById('cue_display').innerHTML = 'Too Slow!';
        window.timed_out=false;
      }
      cue_display.className='cue shown';
      document.getElementById('cue_display').style.fontSize='26px';

    } else {
      document.getElementById('cue_display').innerHTML = '+';
      cue_display.className='cue';
    }
    load_once = false;
  }
  // reveal the cue with 'onset_cue' time remaining before the stimulus reveal
  if (trial_timer >= -onset_cue && only_once_cue){
    document.getElementById('cue_display').innerHTML = '+';
    document.getElementById('cue_display').style.fontSize = '40px';
    cue_display.className = 'cue shown';
    only_once_cue=false;
  }
  if (trial_timer >= 0 && only_once_stim){
    cue_display.className = 'cue';
    display_left.className += ' shown';
    display_right.className += ' shown'
    this.parameters.img_reveal = trial_timer;
    only_once_stim = false;
  }
}

// footer 
document.getElementById('foot_instruction').innerHTML = window.foot_instruction;
if (window.trialNo == 0){
  document.getElementById('trial_counter').innerHTML = "Trial: " + window.trials_per_block + "/" + window.trials_per_block;  
} else{
  document.getElementById('trial_counter').innerHTML = "Trial: " + window.trialNo + "/" + window.trials_per_block;
}
// override respond()
this._respond = this.respond;
this.respond = (response=null, timestamp=undefined) => {
  // response === this.parameters.response;
  // this.parameters.correct = (response === this.parameters.correctResponse);
  // only accept responses once the stimulus has been revealed
  if (!only_once_stim && one_response){
    let wait = this.parameters.selection_duration;
    selections[response].className += ' border';
    // if (this.parameters.practice) {
    //     wait = this.parameters.practiceFeedbackDuration;
    //     selections[this.parameters.correctResponse].className += ' shown';
    // }

    this.parameters.winner = trial_stimuli[response];
    this.parameters.loser  = trial_stimuli[Math.abs(response - 1)]
    window.response_time = trial_timer;
    window.n_left_responses += Math.abs(Number(response) - 1);
    window.n_right_responses += Number(response);
    
    if (window.response_time < window.fast_response) {
      window.feedback = true;
      window.n_fast_responses += 1;
    } else if (!window.timed_out) {
      window.feedback=false;
    }
    setTimeout(() => {
      this._respond(response, timestamp);
    }, wait);
    one_response = false;
  } else {
    //response=null;
  }
}

let iid = setInterval(run_trial, 1/fps*1000);
let end = (reason) => {
  clearInterval(iid)
  if (reason==='timeout'){
    window.feedback=true;
    window.timed_out=true;
    window.response_time=NaN;
    window.n_slow_responses += 1;
  }
  return this.originalEnd(reason)
}
this.originalEnd = this.end;
this.end = end;

